import React, {useEffect, useState} from 'react'
import "./App.css";

function App(){

  const [backendData, setBackendData] = useState("");

  useEffect(() => {
    fetch("/ratings").then(
      response => response.json()
      ).then(
        data => {
          setBackendData(data.ratings);
        }
      )
  }, []);

  return(
    <div>
      <h1>{backendData}</h1>
    </div>
  )
}

export default App
